import React from 'react';
import {Link} from 'react-router-dom';
import styles from './Navigation.module.css';

function Navigation(){
    function clickMenuButton(){
        menuButton.classList.toggle('is-active');
    }
    return ( 
            <nav className={styles.navBar}>
                <div className={styles.menu}>
                    <ul className>
                        <li className={styles.navBarEntry}><Link to = '/'>About Us</Link></li>
                        <li className={styles.navBarEntry}><Link to = '/'>Registration</Link></li>
                    </ul>
                </div>
                var menuButton = <button id = 'menuButton1' className={styles.menuButton} onClick = {clickMenuButton}>
                    <span className={styles.buttonLine}></span>
                    <span className={styles.buttonLine}></span>
                    <span className={styles.buttonLine}></span>
                </button>
            </nav>
    );
}
export default Navigation;
